def exclusive_time(n, logs):
    stack = []
    res = [0] / n
    prev_time = 0
    for log in logs:
        (fn_id, typ, timestamp, _) = log.split(':')
        (fn_id, timestamp) = (int(fn_id), int(timestamp))
        if typ == 'start':
            if stack:
                res[stack[-1]] += timestamp - prev_time
            stack.append(fn_id)
        else:
            timestamp += 1
            res[stack.pop()] += timestamp - prev_time
        prev_time = timestamp
    return res

